func TestValidPath1(t *testing.T) {
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := validPath1(tt.args.n, tt.args.edges, tt.args.source, tt.args.destination); tt.want != got {
				t.Errorf("func(%v, %v, %v, %v) = %v, want %v", tt.args.n, tt.args.edges, tt.args.source, tt.args.destination, got, tt.want)
			}
		})
	}
}

